import React, { Component } from 'react';
import { Navbar, Nav, Button, NavItem } from 'react-bootstrap';
import 'font-awesome/css/font-awesome.min.css'


class OrderList extends Component {
  render() {
    return (
        <Navbar bg="light" variant="light">
            <Nav className="right">
                <NavItem>
                    <Nav.Link>
                    <Button variant="outline-primary"><i className="fa fa-home"></i></Button>
                    </Nav.Link>
                </NavItem>

                <NavItem>
                    <Nav.Link>
                    <Button variant="outline-primary"><i className="fa fa-sign-out"></i></Button>   
                    </Nav.Link>
                </NavItem>


            </Nav>   
        </Navbar>
    );
  }
}

export default OrderList;
